.painel-detalhes p {
  color: #455a64;
  line-height: 1.8; /* Leitura mais confortável */
  font-size: 1.1rem;
  text-align: justify;
  margin-bottom: 30px;
}

/* Botão */
.btn-voltar {
  display: block;
  width: 50%; /* Botão mais contido, não ocupa tudo */
  margin: 0 auto; /* Centraliza o botão */
  padding: 14px;
  background-color: #2196F3;
  color: white;
  border: none;
  border-radius: 30px; /* Botão arredondado */
  font-size: 1rem;
  font-weight: bold;
  cursor: pointer;
  transition: all 0.2s;
